    # function to return the max divisible sum
    def get_max_divisible_sum(n: int, k: int) -> int:
        # base case
        if k == 0 or n == 0:
            return 0
        # recursion call to get maximum divisible sum of the whole matrix
        return max(get_max_divisible_sum_by_k(n, k, n - 1), get_max_divisible_sum(n - 1, k))
    return str(get_max_divisible_sum(m, k))

