    day_preparation_table = {}
    for day, exam, preparation_day in days:
        day_preparation_table[day] = day_preparation_table.get(day, 0) + 1
        if day < preparation_day:
            day_preparation_table[preparation_day] += 1

    possible_schedules = []
    # make a list of possible schedules
    for day in range(1, n+1):
        if day not in day_preparation_table:
            possible_schedules.append([0] * m)
        else:
            possible_schedules.append([0] * m)

    for day, exam, preparation_day in days:
        for i in range(exam):
            if day < preparation_day:
                possible_schedules[day][i] = 1
            else:
                possible_schedules[preparation_day][i] = 1
    if not possible_schedules[-1][-1]:
        return "-"
    for i in range(m):
        possible_schedules[-1][i] = 0
    for i in range(m-1, -1, -1):
        for j in range(i, -1, -1):
            if possible_schedules[j][i] == 0:
                possible_schedules[j][i] = 1
                break
    result = []
    for i in range(n):
        result.append(str(i+1) + " " + " ".join(map(str, possible_schedules[i])))
    return "\n".join(result)


