    def segment_degenerate_with_point(start_segment, end_segment, point):
        return is_segment_degenerate(start_segment, end_segment) or is_point_in_intersecting_segment(point, start_segment, end_segment)

    def segment_degenerate_with_segment(start_segment, end_segment):
        return is_segment_degenerate(start_segment, end_segment)

