    s = list(map(int, stdin.split()))
    n, k = s[0], s[1]
    if k > n:
        return ''

    # Now we have n >= k so we can take k-1 copies of k-1 elements and put them into the array
    # and search through all permutations of k-1 elements
    # and if one of them can reduce the number of copies in the array we can cut out the copy
    def search_for_cut(arr, k):
        for i in range(1, k + 1):
            if can_cut_out(arr, i):
                return i
        return 0

    # Can cut out some number of k elements
    def can_cut_out(arr, k):
        s = set(arr)
        for i in range(1, k + 1):
            if i not in s:
                return False
        return True

    return''.join(map(str, [search_for_cut(s, k)]))


