    p = list(map(int, stdin.strip().split()))
    k = max(p)
    p.sort()

    def do(n, p, k):
        if len(p) == 1:
            return p

        def get_child(i, p):
            if i < n:
                return get_child(i + 1, p)
            else:
                return p[(i + 1) % n]

        def swap(i, p):
            return (i - 1) % n, (i + 1) % n

        def new(p):
            p1, p2 = swap(p[0], p)
            return p1, p2

        def old(p):
            p1, p2 = swap(p[0], p)
            return p2, p1

        def order(p, kid, kid2, kid1, kid21):
            #kid - kid1
            if kid == kid2:
                return kid1, kid21
            if kid == kid1:
                return kid2, kid1

            p1, p2 = kid2, kid1

            if p1 == kid:
                return kid2, kid1
            else:
                return kid2, kid1

        a, b = get_child(0, p), get_child(1, p)
        x, y = new(p), new(p)
        c, d = order(p, a, b, x, y)

        if x!= c or y!= d:
            if p[0] == c:
                p, x = new(p), new(p)
            else:
                p, x = old(p), old(p)

        if p[0] == x:
            return p[0], p[1]
        else:
            return p[1], p[0]

    return " ".join(map(str, do(n, p, k)))

