    n, m = map(int, stdin.split())
    grid = [list(stdin[i]) for i in range(n)]
    stack = []
    for row in grid:
        row = list(row)
        if row[0] == '*':
            if row[-1] == '*':
                stack.append(row)
        else:
            row.reverse()
            if row[-1] == '*':
                stack.append(row)
    if len(stack) > n * m:
        return '-1'
    curr_size = 1
    prev_size = 1
    while stack:
        row = stack.pop()
        curr_row = []
        if row[0] == '*':
            for i in range(prev_size):
                curr_row.append(row[i])
        else:
            for i in range(prev_size):
                curr_row.append(row[-i - 1])
        curr_row.reverse()
        if curr_row == stack[-1]:
            curr_size += 1
            if curr_size > n * m:
                return '-1'
            continue
        if curr_size == n * m:
            return '-1'
        stack.append(row)
        prev_size = curr_size
        curr_size = 1
    curr_row = []
    for i in range(prev_size):
        curr_row.append(row[i])
    curr_row.reverse()
    if curr_row == stack[-1]:
        curr_size += 1
    if curr_size == n * m:
        return '-1'
    return str(curr_size) +'' + str(curr_row[0][0]) +'' + str(curr_row[-1][-1])

